      SELECT DISTINCT - CAST ( - col2 AS INTEGER ) * + CAST ( - col0 AS REAL ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 * - col2 / 3 - + col1 BETWEEN NULL AND - col1 * + 93 * col2 / - 30;
  - name: tab0

outputs:
  - name: q2274.out
    data: |
